import React from 'react';
import { BrowserRouter, Switch, Route } from 'react-router-dom';
import  Sign_In  from '../ pages/authorization/sign_in';


const Router = ( props : any) => {

    return(

        <BrowserRouter>
            <Switch>
                <Route exact path = "/">
                    {<Sign_In {...props} /> }
                </Route>
            </Switch>
        </BrowserRouter>
    );
}

export default Router
